import Expcard from "./Expcard";
import Expcarddata from "./Expcarddata";
function Experience() {
    return (<>

        <div className="container-fluid Experience mt-5 ">
            <div className="row d-flex justify-conten-center ">

                <div className="col-10 mx-auto">

                    <div className="">
                        <h1 className="heading text-center">Experience</h1>
                    </div>

                </div>

                <div className="col-10 mx-auto ">
                    <div className="row d-flex justify-content-between flex-nowrap overflow-auto p-5 ">
                    {
                      Expcarddata.map((val,ind)=>{
                        return <Expcard date={val.date} title={val.title} para={val.para}/>
                      })}
                    </div>


                </div>
            </div>
        </div>
    </>);
}

export default Experience;
